import React, { Component } from "react";
import { Link } from "react-router-dom";

const Nav = () => {
    return (
        <div>
            <Link to = '/'>Home</Link>
            <Link to = 'dog/create/' >Create new Dog!</Link>
        </div>
    )
};

export default Nav;
